import './App.css';

function App() {
  return (
    <div id = 'root'>
      <section className="section">
        <div className="container">
          <h1 className="title"> Hello World </h1>
          <p className="subtitle"> My React app with <strong>Bulma</strong></p>
        </div>
      </section>
    </div>
  );
}

export default App;
